import Post from './Post';
import { Link } from 'react-router-dom';
import {AiOutlineClockCircle, AiOutlineComment, AiOutlineShareAlt } from "react-icons/ai"

const PostsFeed = ({ posts }) => {
    return (
        <>
            {posts.map(post => (
                <Post key={post.id} post={post} />
            ))}
            <button className='botton'><Link to="/">Home</Link></button>
            <a className='botton' href="/"><i class="material-icons">&#xE254;</i></a>
            <AiOutlineClockCircle className='icon' /> <label htmlFor=''>2</label>
            <AiOutlineComment className='icon' /> <label htmlFor=''>27</label>
            <AiOutlineShareAlt className='icon' /> <label htmlFor=''>SHARE</label>
                  
        </>
    )
}

export default PostsFeed
